export default function Router(){

  let ThemeRoutes = useRoutes([



      { path: "/",
      element: <PageHeader /> ,

      },
      { path: "/profil",
      element: <Profil /> ,

      },
      { path: "/profil",
      element: <Profil /> ,

      },

    ]);


return ThemeRoutes ;}
